    "Preliminary assessment of potential environmental effects of the Borealis iron
    ore development proposal on birds of Melville Peninsula, N.W.T",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:01:57.004866",nt"name": "preliminary-assessment-of-potential-environmental-effects-of-the-borealis-iron-ore-develop",nt"isopen":
    false,nt"url": null,nt"notes": "Vegetation communities in the Parry Bay
    area of Melville Peninsula, North West Territory were segregated into 10 classes
    through a combined biophysical and automatic computer classification approach using
    LANDSAT imagery. The color-coded, 1:70 000 scale maps produced from the classification
    were used to prepare a derivative map showing the distribution of habitat most attractive
    to water oriented birds in the Parry Bay area. Aerial surveys were conducted of
    the shorefast ice edge in Parry Bay, along the shoreline from Hall Beach to Cape
    Jermain and along transects established in terrestrial areas of the Parry Bay region
    to determine the significance of the area to birds. A reconnaissance survey of the
    Ajaqutalik River was also flown. Results of the survey are discussed and areas within
    the study area which appear to be most important to loon, waterfowl and other bird
    species are described and mapped.",nt"license_title": "License Not Specified",nt"extras":
